import{_ as e,c as a,o as t,aa as o}from"./chunks/framework.d_Ke7vMG.js";const u=JSON.parse('{"title":"Maven实战","description":"","frontmatter":{"title":"Maven实战","author":"Herman","updateTime":"2021-08-14 13:41","desc":"书籍","categories":"书籍","tags":"书籍/PDF","outline":"deep"},"headers":[],"relativePath":"Notes/No5Books/Maven实战 PDF.md","filePath":"Notes/No5Books/Maven实战 PDF.md","lastUpdated":1723563552000}'),n={name:"Notes/No5Books/Maven实战 PDF.md"},r=o('<h1 id="maven实战" tabindex="-1">Maven实战 <a class="header-anchor" href="#maven实战" aria-label="Permalink to &quot;Maven实战&quot;">​</a></h1><p><img src="https://raw.githubusercontent.com/silently9527/images/main/008i3skNgy1gua7kl7r6zj607i09mjrc02.jpg" alt=""></p><h1 id="内容简介" tabindex="-1">内容简介 <a class="header-anchor" href="#内容简介" aria-label="Permalink to &quot;内容简介&quot;">​</a></h1><p>你是否早已厌倦了日复一日的手工构建工作？你是否对各个项目风格迥异的构建系统感到恐惧？Maven——这一Java社区事实标准的项目管理工具，能帮你从琐碎的手工劳动中解脱出来，帮你规范整个组织的构建系统。不仅如此，它还有依赖管理、自动生成项目站点等超酷的特性，已经有无数的开源项目使用它来构建项目并促进团队交流，每天都有数以万计的开发者在访问中央仓库以获取他们需要的依赖。</p><p>本书内容全面而系统，Maven的原理、使用方法和高级应用尽含其中；注重实战是本书的另一个特点，不仅在各个知识点都辅有大量的小案例，而且还有一个综合性的案例贯穿全书。如果你想使用Maven，或正在使用Maven，本书将给你绝佳的指导。</p><h1 id="下载地址" tabindex="-1">下载地址 <a class="header-anchor" href="#下载地址" aria-label="Permalink to &quot;下载地址&quot;">​</a></h1><blockquote><p><a href="http://share.silently9527.cn/f/30732796-512348815-d48486" target="_blank" rel="noreferrer">http://share.silently9527.cn/f/30732796-512348815-d48486</a></p></blockquote><p>免责声明 电子书书籍全部来源于网络其他人的整理，这里只是收集整理了他们的链接，只做学习和交流使用，版权归原作者所有，如有侵权，请马上联系我，我立马删除对应链接。邮箱：380303318@qq.com</p>',8),s=[r];function i(c,l,_,d,h,p){return t(),a("div",null,s)}const v=e(n,[["render",i]]);export{u as __pageData,v as default};
